"use strict";(self.webpackChunkhaisaz=self.webpackChunkhaisaz||[]).push([[164],{9930:e=>{e.exports=JSON.parse('{"version":{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"category","label":"HarmonicAI Work Programme","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"WP1: Project Management","href":"/haisaz/docs/tutorial-basics/wp1","docId":"tutorial-basics/wp1","unlisted":false},{"type":"link","label":"WP2: Requirement Gathering and Use Case Co-Design","href":"/haisaz/docs/tutorial-basics/wp2","docId":"tutorial-basics/wp2","unlisted":false},{"type":"link","label":"WP3: Explainable AI Models and Evaluation Metrics","href":"/haisaz/docs/tutorial-basics/wp3","docId":"tutorial-basics/wp3","unlisted":false},{"type":"link","label":"WP4: Bias Mitigation Techniques and AI Fairness Metrics","href":"/haisaz/docs/tutorial-basics/wp4","docId":"tutorial-basics/wp4","unlisted":false},{"type":"link","label":"WP5: Hybrid Learning Paradigm for Secure and PrivacyPreserving AI","href":"/haisaz/docs/tutorial-basics/wp5","docId":"tutorial-basics/wp5","unlisted":false},{"type":"link","label":"WP6: Human-machine Collaborative Multi-Objective Model Selection","href":"/haisaz/docs/tutorial-basics/wp6","docId":"tutorial-basics/wp6","unlisted":false},{"type":"link","label":"WP7: Implementation, Testing and Stakeholder-Centered Evaluation in Use Cases","href":"/haisaz/docs/tutorial-basics/wp7","docId":"tutorial-basics/wp7","unlisted":false}],"href":"/haisaz/docs/category/harmonicai-work-programme"}]},"docs":{"tutorial-basics/wp1":{"id":"tutorial-basics/wp1","title":"WP1: Project Management","description":"WP1 mainly provides the coordination of scientific and administrative activities. Project management, budget allocation, and reporting activities will be all be coordinated as part of this work package. This work package will be led by UEvora who has extensive experience in project management.","sidebar":"tutorialSidebar"},"tutorial-basics/wp2":{"id":"tutorial-basics/wp2","title":"WP2: Requirement Gathering and Use Case Co-Design","description":"WP2 is focused on requirement gathering and use-case co-design. Consequently, the key task is to gather requirements and expectations from healthcare stakeholders for the design and evaluation of trustworthy AI solutions and establish high-level requirements of technical research activities of the project. We will then define relevant and convincing use cases in view of promoting the capabilities of developed solutions.","sidebar":"tutorialSidebar"},"tutorial-basics/wp3":{"id":"tutorial-basics/wp3","title":"WP3: Explainable AI Models and Evaluation Metrics","description":"WP3 is geared towards developing explainable AI models and evaluation Metrics. Harmonic AI will develop explainable AI models with respect to use cases. We will establish formal quantitative evaluation metrics for the quality of AI explainability in the healthcare domain. Lastly, the WP will propose a design framework for explainable AI in digital health.","sidebar":"tutorialSidebar"},"tutorial-basics/wp4":{"id":"tutorial-basics/wp4","title":"WP4: Bias Mitigation Techniques and AI Fairness Metrics","description":"WP4 aims to develop bias mitigation techniques, AI fairness Metrics and operational guidelines. WP will design bias mitigation techniques to improve AI fairness with respect to use cases. WP will also explore design fair AI operational guidelines for healthcare organisations. Lastly, we will establish unified quantitative AI fairness evaluation metrics.","sidebar":"tutorialSidebar"},"tutorial-basics/wp5":{"id":"tutorial-basics/wp5","title":"WP5: Hybrid Learning Paradigm for Secure and PrivacyPreserving AI","description":"WP5 will propose a three-tier privacy-preserving hybrid learning paradigm for prioritised predictions. It will integrate state-of-the-art privacy enhancing technologies into the proposed hybrid learning paradigm.The WP will develop security mechanisms to defend against attacks towards the cyber-physical system and AI models and datasets.Lastly, the WP will establish a quantitative metric to measure global privacy loss.","sidebar":"tutorialSidebar"},"tutorial-basics/wp6":{"id":"tutorial-basics/wp6","title":"WP6: Human-machine Collaborative Multi-Objective Model Selection","description":"WP6 will integrate the proposed explainability, fairness and privacy innovations into a unified AI pipeline. We will develop a human-guided multi-objective model selection algorithm.Further, we will develop a human-machine co-design framework for domain-specific, requirement-oriented trustworthy AI in digital health.","sidebar":"tutorialSidebar"},"tutorial-basics/wp7":{"id":"tutorial-basics/wp7","title":"WP7: Implementation, Testing and Stakeholder-Centered Evaluation in Use Cases","description":"WP7 will implement the proposed explainable, fair and private AI solutions in use cases. WP will evaluate the proposed human-machine collaborative multi-objective design framework for trustworthy AI. Lastly, WP will evaluate the proposed guidelines for AI practitioners and healthcare stakeholders.","sidebar":"tutorialSidebar"}}}}')}}]);